import * as tfc from '@tensorflow/tfjs-core';
import { getParamValue } from './utils';

function nmsParams(node, tensorMap, context) {
  const boxes = getParamValue('boxes', node, tensorMap, context);
  const scores = getParamValue('scores', node, tensorMap, context);
  const maxOutputSize = getParamValue('maxOutputSize', node, tensorMap, context);
  const iouThreshold = getParamValue('iouThreshold', node, tensorMap, context);
  const scoreThreshold = getParamValue('scoreThreshold', node, tensorMap, context);
  const softNmsSigma = getParamValue('softNmsSigma', node, tensorMap, context);
  return {
    boxes,
    scores,
    maxOutputSize,
    iouThreshold,
    scoreThreshold,
    softNmsSigma
  };
}

export const executeOp = async (node, tensorMap, context) => {
  switch (node.op) {
    case 'NonMaxSuppressionV5':
      {
        const _nmsParams = nmsParams(node, tensorMap, context),
              boxes = _nmsParams.boxes,
              scores = _nmsParams.scores,
              maxOutputSize = _nmsParams.maxOutputSize,
              iouThreshold = _nmsParams.iouThreshold,
              scoreThreshold = _nmsParams.scoreThreshold,
              softNmsSigma = _nmsParams.softNmsSigma;

        const result = await tfc.image.nonMaxSuppressionWithScoreAsync(boxes, scores, maxOutputSize, iouThreshold, scoreThreshold, softNmsSigma);
        return [result.selectedIndices, result.selectedScores];
      }

    case 'NonMaxSuppressionV4':
      {
        const _nmsParams2 = nmsParams(node, tensorMap, context),
              boxes = _nmsParams2.boxes,
              scores = _nmsParams2.scores,
              maxOutputSize = _nmsParams2.maxOutputSize,
              iouThreshold = _nmsParams2.iouThreshold,
              scoreThreshold = _nmsParams2.scoreThreshold;

        const padToMaxOutputSize = getParamValue('padToMaxOutputSize', node, tensorMap, context);
        const result = await tfc.image.nonMaxSuppressionPaddedAsync(boxes, scores, maxOutputSize, iouThreshold, scoreThreshold, padToMaxOutputSize);
        return [result.selectedIndices, result.validOutputs];
      }

    case 'NonMaxSuppressionV3':
    case 'NonMaxSuppressionV2':
      {
        const _nmsParams3 = nmsParams(node, tensorMap, context),
              boxes = _nmsParams3.boxes,
              scores = _nmsParams3.scores,
              maxOutputSize = _nmsParams3.maxOutputSize,
              iouThreshold = _nmsParams3.iouThreshold,
              scoreThreshold = _nmsParams3.scoreThreshold;

        return [await tfc.image.nonMaxSuppressionAsync(boxes, scores, maxOutputSize, iouThreshold, scoreThreshold)];
      }

    case 'Where':
      {
        const condition = getParamValue('condition', node, tensorMap, context).asType('bool');
        const result = [await tfc.whereAsync(condition)];
        condition.dispose();
        return result;
      }

    case 'ListDiff':
      {
        return tfc.setdiff1dAsync(getParamValue('x', node, tensorMap, context), getParamValue('y', node, tensorMap, context));
      }

    default:
      throw TypeError("Node type ".concat(node.op, " is not implemented"));
  }
};
export const CATEGORY = 'dynamic';
